Ember.TEMPLATES["sponsoring"] = Ember.Handlebars.template(function anonymous(Handlebars,depth0,helpers,partials,data) {
this.compilerInfo = [3,'>= 1.0.0-rc.4'];
helpers = helpers || Ember.Handlebars.helpers; data = data || {};
  


  data.buffer.push("<main>\n<section>\n  <h1>Sponsoring</h2>\n  <p>\n    AfricaHackTrip is about tech communities. We want to connect people and\n    share knowledge. Doing business is not a primary goal, so the participants\n    will spend their personal time and money. Because it's going to be\n    fun and we believe we can do something good for the tech scene.\n  </p>\n  <p><strong>\n    Partners help us lower the costs, host more and better events for more\n    people and produce a better movie.\n  </strong></p>\n  <p>\n    AfricaHackTrip will organize four hack events in four capital cities\n    reaching hundreds of developers. At the end of our trip we will be present\n    at <a href=\"http://www.demo-africa.com/\">DEMO Africa</a> the continent's\n    largest startup event. We will be filming throughout our journey and\n    release a documentary movie about our experiences when we get back.\n  </p>\n  <p>\n    The events or our movie might be your spot. We'll gladly mention our partners\n    and place their logos in any published material. As a sponsor you will be\n    visible to everyone we meet: startups, developers and other forward-thinking\n    people in a new market with huge growth potential. You can also send people\n    to the events to get involved personally, for example by giving workshops.\n  </p>\n</section>\n<section>\n  <h1>Budget</h1>\n  <p>\n    In total, we'd need about $30,000 to cover all expenses (except our return\n    tickets to Africa and our food &amp; drinks). Your contribution could go\n    towards one of these categories:\n  </p>\n  <ul>\n    <li>\n      Events (venues, catering, prizes)\n    </li>\n    <li>\n      Professional film gear (rental) and high-quality post-production\n    </li>\n    <li>\n      Transport in Africa, visa and accomodation\n    </li>\n  </ul>\n  <p>\n    This is our spread sheets for all the costs:\n    <a href=\"https://docs.google.com/document/d/1LXG2N8S-CB9ltruBT_H9khO7N60AJbUGKaYTs2-6mhs/edit?usp=sharing\">AfricaHackTrip Cost Breakdown</a>\n  </p>\n</section>\n<section>\n  <h1>Get involved!</h1>\n  <p>\n    Sponsorship packages range from $1000 to $5000. Or you can tell us how you\n    would like to partner up with us, and we'll work out a customized package\n    with you.\n  </p>\n  <p>\n    <strong><a href=\"mailto:hello@africahacktrip.org?subject=AfricaHackTrip%20Partnership\">Just get in touch with us</a></strong>,\n    and we'll work something out!\n  </p>\n</section>\n");
  
});

